import React from "react";
import '../index.css';
import { handleNumberKeys } from "./Screen";

function Grid()
{
    return (<div className='grid'>
    <button onClick={handleNumberKeys(0)}>0</button>
    <button onClick={handleNumberKeys(1)}>1</button>
    <button onClick={handleNumberKeys(2)}>2</button>
    <button onClick={handleNumberKeys(3)}>3</button>
    <button onClick={handleNumberKeys(4)}>4</button>
    <button onClick={handleNumberKeys(5)}>5</button>
    <button onClick={handleNumberKeys(6)}>6</button>
    <button onClick={handleNumberKeys(7)}>7</button>
    <button onClick={handleNumberKeys(8)}>8</button>
    <button onClick={handleNumberKeys(9)}>9</button>
    <button >.</button>
    <button >%</button>
    <button >+</button>
    <button>*</button>
    <button>-</button>
    <button>/</button>
    <button>clr</button>
    <button>Ans</button>
    </div>
    );
}

export default Grid;
